  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:02.449303\",\n\t\"name\": \"wetlands-management-review-of-st-vincent-island-nwr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this wetland review was
  to evaluate past management and provide recommendations for future management of
  the impounded wetlands on St. Vincent Island.  The cattail infestation around Oyster
  Pond and in the marshlands was specifically addressed in this study.  Recommended
  methods for controlling cattails include: burning, flooding, herbicide, drawdowns,
  aquatic sickle cutter, salt water, muck/scrap/dredge, and trail cutter.  Combinations
  of these control methods are evaluated for effectiveness in both short- and long-term
  management.  Cattail monitoring recommendations are also made.\",\n\t\"license_title\":
